import React, { Component } from "react";
import "./weather.css"

class RainAnimTest extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div style>
      <div className='weather rain'></div>
      <div className='weather rain'></div>
      <div className='weather rain'></div>
      </div>
    );
  }
}

export default RainAnimTest;
